import { BrowserRouter, Link, Route, Switch } from "react-router-dom";
import CuerpoReg from "./CuerpoReg";

export default function NavegarIngreso(){
    return(
        <BrowserRouter>
            <Route>
                <Link className="Link" render={()=>{<CuerpoReg/>}}>Ingresar</Link>
                <Link className="Link">Registrar</Link>
            </Route>
        </BrowserRouter>
    )
}
